import { observable, action } from 'mobx';


export default class posstore {
  @observable mylat = navigator.geolocation.getCurrentPosition((my) => {
    return my.coords.latitude;
  })
  @observable mylng = 0;
  
  @action getPosition2 = () => {
    navigator.geolocation.getCurrentPosition((me) => {
      this.mylat = me.coords.latitude;
      this.mylng = me.coords.longitude;
  });
  }

  @action decrease = () => {
    this.number--;
  }
}
